import Movie from './Movie';
import HookItem from './HookItem';
import './Hook.css';

function Hook(props) {
  let i = 0;
  return (
    <Movie className="hook">
      for (i of props)
      {
        <HookItem
          title={props.items[i].title}
          rating={props.items[i].rating}
          date={props.items[i].date}
        />
      }
    </Movie>
  );
  i++;
}

export default Hook;
